import React from "react";
import { Link } from "react-router-dom";

import SingleDefaultLayout from "../common/singleDefaultLayout";

const SingleRental = ({ deleteRental, _id, name, customer, movie }) => {
  console.log(movie);
  return (
    <SingleDefaultLayout>
      <div>
        <Link to={`/rentals/${_id}`}>{name}</Link>
        <p>{customer.name}</p>
        <p>
          movie rented: <b>{movie.title}</b>
        </p>
        <p>
          phone: <b>{customer.phone}</b>
        </p>
        <button
          className="btn btn-danger"
          onClick={() => {
            deleteRental(_id);
          }}
        >
          Delete Rental
        </button>
      </div>
    </SingleDefaultLayout>
  );
};

export default SingleRental;
